description:
Mecho Wars is a turn-based strategy game set in a fantastic world created by Luc Bernard. Two factions are at war: the Winged Crusade and the Landians. 

Take control of either side in story-driven campaigns across multiple episodes. Or, take the fight online and face-off against other players!

